:root {
    /* Transparent nuances */
    --TR1: hsla(200, 19%, 15%, 0);
    --TR2: hsla(200, 19%, 18%, 0.5);
    --TR3: hsla(200, 19%, 18%, 0.88);
    --TR4: hsla(200, 19%, 70%, 0.66);

    /* Opaque nuances */
    --OP1: hsla(200, 19%, 15%, 1);
    --OP2: #0f111a;
    --OP3: hsla(200, 19%, 21%, 1);
    --OP4: hsla(200, 19%, 26%, 1);
    --OP5: hsla(200, 19%, 30%, 1);
    --OP6: hsla(200, 19%, 32%, 1);
    --OP7: hsla(200, 19%, 36%, 1);
    --OP8: hsla(200, 19%, 50%, 1);
    --OP9: hsla(200, 19%, 60%, 1);
    --OP10: hsla(200, 19%, 63%, 1);
    --OP11: hsla(200, 19%, 66%, 1);
    --OP12: hsla(200, 19%, 70%, 1);
    --OP13: hsla(200, 19%, 75%, 1);
    --OP14: hsla(200, 19%, 76%, 1);
    --OP15: hsla(200, 19%, 80%, 1);
    --OP16: hsla(200, 19%, 84%, 1);
    --OP17: hsla(200, 19%, 90%, 1);
    --OP18: hsla(200, 19%, 95%, 1);

    /* Grey nuances*/
    --GREY1 : hsla(0, 0%, 100%, 0.13);
    --GREY2 : hsla(0, 0%, 100%, 0.33);
    --GREY3 :  hsla(0, 0%, 100%, 0.4);
    --GREY4 : hsla(0, 0%, 100%, 0.55);
    --GREY5 : hsla(0, 0%, 100%, 0.66);
    --GREY6 : hsla(0, 0%, 100%, 0.7);
    --GREY7 :  hsla(0, 0%, 100%, 0.77);
    --GREY8 : hsla(0, 0%, 100%, 0.85);
    --GREY9 : hsla(198, 5%, 60%, 1);
    --GREY10 :  hsla(0, 0%, 0%, 0.7);

    /* Labels */
    --LB1 : hsla(0, 45%, 55%, 1);
    --LB2 : hsla(30, 45%, 55%, 1);
    --LB3 : hsla(60, 45%, 55%, 1);
    --LB4 : hsla(90, 45%, 55%, 1);
    --LB5 : hsla(120, 45%, 55%, 1);
    --LB6 : hsla(180, 45%, 55%, 1);
    --LB7 : hsla(220, 45%, 55%, 1);
    --LB8 : hsla(270, 45%, 55%, 1);
    --LB9 : hsla(330, 45%, 55%, 1);
}


