@hover-color-light: rgba(255,255,255,.05);
@hover-effect-light: inset 10000px 0px 0px @hover-color-light;
@active-color-light:  rgba(255,255,255,.1);
@active-effect-light: inset 10000px 0px 0px @active-color-light;
